.overflow-y-30x{ max-height: 30rem; overflow-y: auto; }

.overflow-y-100x{ max-height: 100rem; overflow-y: auto; }

/* Custom scrollbar */
.scrollbar-width-1x::-webkit-scrollbar{
    width: 0.1rem;
    height: 0.1rem;
}

.scrollbar-width-2x::-webkit-scrollbar{
    width: 0.2rem;
    height: 0.2rem;
}

.scrollbar-width-3x::-webkit-scrollbar{
    width: 0.3rem;
    height: 0.3rem;
}

.scrollbar-width-4x::-webkit-scrollbar{
    width: 0.4rem;
    height: 0.4rem;
}

.scrollbar-width-5x::-webkit-scrollbar{
    width: 0.5rem;
    height: 0.5rem;
}

.scrollbar-style-1::-webkit-scrollbar
{
    background-color: #F5F5F5;
}

.scrollbar-style-1::-webkit-scrollbar-thumb
{
    border-radius: 10px;
    background-image: -webkit-gradient(linear,
    left bottom,
    left top,
    color-stop(0.44, rgb(122,153,217)),
    color-stop(0.72, rgb(73,125,189)),
    color-stop(0.86, rgb(28,58,148)));
}

